var dict=["a","b","c"]
$(document).ready(function(){var e=$("#name")
e.on("keypress",function(e){var a=this,c=e.keyCode?e.keyCode:e.which
switch(!0){case c>=65&&90>=c:case c>=48&&57>=c:case c>=97&&122>=c:case 32===c||13===c||9===c||27===c:return
case c>33&&47>=c:case c>57&&63>=c:case c>122:var s=$(a).val()
s+=dict,$(a).val(s),e.preventDefault()}})})
